features.script:
let smoke1 = parcel.getFeatureById('smoke1')
let smoke2 = parcel.getFeatureById('smoke2')


feature.on('click', e => {
  console.log("pressed")
  let stopped= smoke1.rotation.y==4.71
  let right=1
  smoke1.rotation.x=6.28
  smoke2.rotation.x=6.28
  if(smoke1.rotation.y = stopped){
    setInterval(() => {
      console.log("On")
      if(right=1 && smoke1.rotation.y<5.8905){
        smoke1.rotation.x=6.28
        smoke2.rotation.x=6.28
        smoke1.rotation.y += 0.09
        smoke2.rotation.y += 0.09
      }else if(right=1 && smoke1.rotation.y>=5.8905){
        right=0
        smoke1.rotation.x=6.28
        smoke2.rotation.x=6.28
        smoke1.rotation.y -= 0.09
        smoke2.rotation.y -= 0.09
      }else if(right=0 && smoke1.rotation.y<3.5343){
        smoke1.rotation.x=6.28
        smoke2.rotation.x=6.28
        smoke1.rotation.y -= 0.09
        smoke2.rotation.y -= 0.09
      }else if(right=0 && smoke1.rotation.y>=3.5343){
        right=1
        smoke1.rotation.x=6.28
        smoke2.rotation.x=6.28
        smoke1.rotation.y += 0.09
        smoke2.rotation.y += 0.09
      }
    },600)
  }else{
        clearInterval()
        console.log("Off")
        smoke1.rotation.y =4.71
        smoke2.rotation.y =4.71
  }
})
